import Post from "./Post";
import Share from "./Share";


export default function Feed() {
    const HomeFeed = () => {
        return(
            <div>
                <Share/>
            <Post/>
            </div>
            
        )
    }

    return (
        <div className="feed">
            <div className="feed-items">
                <Share/>
                <Post/>
                <Post/>
            </div>
        </div>
    )
}
